import './navbar.css';

import React from 'react';

const Navbar= ({darkTheme})=>{
    return(
        <section className={`navbar-container ${darkTheme ? background-dark:background-tr} `}>
         <div className='flex container justify-between aling-center'>
            <a href='#' className='logo'>Smart<span>Bazzar</span></a>
         
         <nav className='navbar-link-container'>
         <a href='#' className='navbar-link'>Home</a>
         <a href='#' className='navbar-link'>Productos</a>
         <a href='#' className='navbar-link'></a>
        
         </nav>
         </div>
        </section>
    )
}
export default Navbar;
